    const javascript=()=>{
        setImg('https://www.google.com/search?q=javascript+img&tbm=isch&ved=2ahUKEwjss6mrpY7_AhUdFLcAHR4tCuQQ2-cCegQIABAA&oq=javascript+img&gs_lcp=CgNpbWcQAzIJCAAQGBCABBAKMgcIABAYEIAEMgcIABAYEIAEMgkIABAYEIAEEAoyBwgAEBgQgAQyBwgAEBgQgAQyBwgAEBgQgAQyBwgAEBgQgAQyCQgAEBgQgAQQCjIJCAAQGBCABBAKOgQIIxAnOgYIABAIEB46CggAEIoFELEDEEM6BwgAEIoFEEM6BQgAEIAEOgYIABAHEB5QlQ9Ynb4BYNa_AWgAcAB4AIABvgSIAb4SkgEMMC4xMC4wLjEuMC4xmAEAoAEBqgELZ3dzLXdpei1pbWfAAQE&sclient=img&ei=GTBuZKzDA52o3LUPntqooA4&bih=601&biw=1225#imgrc=OYQ59qpDUQL6MM')
    }
    const react=()=>{
        setImg('https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2Fa%2Fa7%2FReact-icon.svg&tbnid=3yb309DfyvIz2M&vet=12ahUKEwjss6mrpY7_AhUdFLcAHR4tCuQQMygBegUIARDAAQ..i&imgrefurl=https%3A%2F%2Fcommons.wikimedia.org%2Fwiki%2FFile%3AReact-icon.svg&docid=nfz2qKo0MFLwMM&w=800&h=696&q=react%20img&ved=2ahUKEwjss6mrpY7_AhUdFLcAHR4tCuQQMygBegUIARDAAQ')
    }
    const Ctwoplus=()=>{
        setImg('https://www.google.com/url?sa=i&url=https%3A%2F%2Fen.wikipedia.org%2Fwiki%2FC%252B%252B&psig=AOvVaw3mDEG3NolmZWg2lJ582LNQ&ust=1685029432410000&source=images&cd=vfe&ved=0CBEQjRxqFwoTCLilwfmljv8CFQAAAAAdAAAAABAE')
    }
    
    return(
        <div>
            <img src={img} height='100px' width='100px'/>
            <button onClick={react}>React</button>
            <button onClick={javascript}>javascript</button>
            <button onClick={Ctwoplus}>C++</button>

        </div>
    )
}
export default Image
